import logo from './logo.svg';
import './App.css';
import NavBar from './components/navbar/navbar';
import HomePage from './screens/HomePage/homepage';
import { BrowserRouter, Switch } from 'react-router-dom';

function App() {
  return (
      <div className="App">
        <NavBar></NavBar>
        <Switch>
          <Route exact path="/">
            <HomePage></HomePage>
          </Route>
        </Switch>
      </div>
  );
}

export default App;
